import s from './Header.module.css';
import cn from "classnames";

const HeaderMobile = () => {

    const openModal = () => {
        document.getElementById('id01').style.display = 'block'
    }

    const closeModal = () => {
        document.getElementById('id01').style.display = 'none'
    }


    return (
        <>
            <button onclick={openModal}
                class={s.w3-button}>Open Modal</button>


            <div id="id01" class={s.w3-modal}>
                <div class={s.w3-modal-content}>
                    <div class={s.w3-container}>
                        <span onclick={closeModal}
                            class={cn(s.w3-button, s.w3-display-topright)}>&times;</span>
                        <p>Какой-то текст в модальном окне..</p>
                        <p>Какой-то текст в модальном окне..</p>
                    </div>
                </div>
            </div>
        </>
    );
}

export default HeaderMobile;
